import React from 'react'
import { useState, useEffect } from 'react';
import { Navigate, useNavigate } from 'react-router-dom';
import Navbar from '../../components/Navbar';
import Piechart from '../../components/Piechart';
import TicketsbyType from '../../components/TicketsbyType';



function UserDashboard({user, tics}) {


  let navigate = useNavigate()

  const userProj = user.projects
  const userTic = user.tickets


  return (
    <div>
      <Navbar />
      <div class="row">
      {user.first_name}
  <div class="col-sm-6">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">Tickets by Type</h5>
       <TicketsbyType user={user} tics={tics}/>
      </div>
    </div>
  </div>
  <div class="col-sm-6">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">Tickets by priority</h5>
        <Piechart user={user} tics={tics}/>
      </div>
    </div>
  </div>
</div>
</div>
  )
}

export default UserDashboard
